const Footer = () => {
    return (
        <div className="d-flex justify-content-around">
            <button Link ="/" className="btn btn-primary">Liste des voitures</button>
            <button href="/client-list" className="btn btn-secondary">Liste des clients</button>
            <button href="/add-car" className="btn btn-success">Ajouter voiture</button>
            <button href="/add-client" className="btn btn-danger">Ajouter client</button>
        </div>
    );
}

export default Footer;
